#! /usr/bin/env python3

# find intersection between sets
a = set(['3', '14', '15', '9', '26', '5', '35', '9'])
b = set(['60','22','14','0','9'])

print(a)
print(b)
print(f'Intersection: {a & b}')

# Find difference
print(f'Difference: {a - b}')

# Find union
print(f'Union: {a | b}')

# Find symetrical difference
print(f'Symetrycal difference: {a ^ b}')

